import React from 'react';

const Settings = () => {
  return (
    <div style={{ padding: '30px' }}>
      <h2 style={{ fontSize: '1.8rem', marginBottom: '20px', color: '#333' }}>Settings</h2>
      <div style={{ background: 'white', padding: '20px', borderRadius: '8px', boxShadow: '0 2px 8px rgba(0,0,0,0.04)' }}>
        <p style={{ color: '#555' }}>Đây là trang cài đặt. Bạn có thể thay đổi các tùy chọn của ứng dụng tại đây.</p>
        <p style={{ color: '#555', marginTop: '10px' }}>Các cài đặt có thể bao gồm quản lý tài khoản, thông báo, hoặc các tùy chỉnh giao diện.</p>
      </div>
    </div>
  );
};

export default Settings;
